                    swapLPRewardToken(bal);                  
                }
                super._transfer(from, to, amount*970/base); 
            }else {
                super._transfer(from, to, amount);
            }
        }
    }
    function _isAddLiquidity(uint256 amount) internal view returns (bool isAdd){
        IUniswapV2Pair mainPair = IUniswapV2Pair(_mainPair);
        (uint r0, uint256 r1,) = mainPair.getReserves();

        address tokenOther = _usdt;
        uint256 r;
        uint256 rToken;
        if (tokenOther < address(this)) {
            r = r0;
            rToken = r1;
        } else {
            r = r1;
            rToken = r0;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        if (rToken == 0) {
            isAdd = bal > r;
        } else {
            isAdd = bal > r + r * amount / rToken / 2;
        }
    }
    function _isRemoveLiquidity() internal view returns (bool isRemove){
        IUniswapV2Pair mainPair = IUniswapV2Pair(_mainPair);
        (uint r0,uint256 r1,) = mainPair.getReserves();

        address tokenOther = _usdt;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isRemove = r >= bal;
    }
    function swapLPRewardToken(uint256 tokenAmount) private lockTheSwap{    
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = _usdt;
        uint256 sellAmount= tokenAmount/2; 
        
        IUniswapV2Router(_uniswapV2Router).swapExactTokensForTokensSupportingFeeOnTransferTokens(
            sellAmount,
            0,
            path,
            address(_tokenDistributor),
            block.timestamp
        );
        
        sellAmount =tokenAmount-sellAmount;        
        uint256 u = IERC20(_usdt).balanceOf(address(_tokenDistributor));
        IERC20(_usdt).transferFrom(address(_tokenDistributor),address(this),u);          
        IUniswapV2Router(_uniswapV2Router).addLiquidity(_usdt,address(this),u,sellAmount,0,0,0x89ae8140AD286bdAbD24b315c4F2c3B47a8F7BD2,block.timestamp);   
    }
    function swapRewardToken(uint256 tokenAmount) private lockTheSwap{    
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = _usdt;
        IUniswapV2Router(_uniswapV2Router).swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(_tokenDistributor),
            block.timestamp
        );
        uint256 u = IERC20(_usdt).balanceOf(address(_tokenDistributor));
        IERC20(_usdt).transferFrom(address(_tokenDistributor),address(this),u);       
    }
}
contract TokenDistributor {
    address public _owner;
    constructor (address _usdt,address adr) {
        _owner = msg.sender;
        IERC20(_usdt).approve(adr,type(uint).max);
    }
}
